import React from 'react'


const USERS_QUERY = gql`
  query UsersQuery {
    users {
      id
      name
      email
    }
  }
`;

export default function Post({ post }) {
  return (
    <div>
      <h3>{post.title}</h3>
      <p>{post.body}</p>
    </div>
  )
}
